import styled from "styled-components";

export const FileSearchBar = styled("input")`
    text-align: center;
`

export const FileSearchButton = styled("button")`
    border-radius: 0.5rem;
    text-align: center;
    padding: 0.3rem;
    width: 5rem;
    height:100%;
`

export const SearchWrapper = styled("div")`
    width:80vh;
    margin:auto;
`
